【たもぎ茸の力の詳細】<br>●たもぎ茸の100％天然エキスです。<br>●収穫したたもぎ茸を、その場で抽出・濃縮。 北海道のたもぎ茸だけで作る自然食品です。<br>●高濃度のβ-Ｄグルカンをはじめ、20種類にも及ぶアミノ酸や生命活動に必要不可欠なミネラル成分がバランスよく含まれています。<br>●お召し上がりの際は目安として１日１回１袋をコップにあけ、ストレートでお飲みください。<br><br>【召し上がり方】<br>●よく振ってからお飲みください。(沈殿物には栄養成分が豊富に含まれております。)<br>●お召し上がりの量などに特別な定めはありませんが、目安として1日1回1袋(80mL)をコップにあけ、ストレートでお飲みください。<br>●食用きのこ「たもぎ茸」なので旨味成分を含みます。お料理にもお使いいただけます。<br><br>【ご注意】<br>○本品のご使用により、体質に合わないと思われる場合はお召し上がりにならないでください。<br>○自然素材を原料としておりますので、色や成分に多少の変化がありますが、品質に問題はありませんので安心してお召し上がりください。<br><br>【原材料】<br>たもぎ茸<br><br>【栄養成分】1袋当たり<br>エネルギー：2.4kcaL、タンパク質：0.88g、脂質：0.08g、炭水化物：0.5g、ナトリウム：5.7mg、灰分：0.32g、リン：42.6mg、鉄：0.65mg、カルシウム：2.8mg、サイアミン(ビタミンBi)：30μg、リボフラビン(ビタミンB2)：0.18mg、ビタミンB6：44μg、葉酸：23μg、パントテン酸：0.30mg、ナイアシン：6.04mg、カリウム：138.4mg、マグネシウム：6.24mg、銅：56.8μg、亜鉛：184μg、マンガン：26μg<br><br>【賞味期限】<br>パッケージに記載<br><br>【内容量】<br>80ml×30袋<br><br>【原産国】<br>日本<br><br>【販売元・製造元・輸入者名】<br>スリービー<br>北海道空知郡南幌町元町1丁目1番1号<br>011-378-2273<br><br>【商品区分】<br>食品<br><br>［エルムマッシュ291］<br><br><br><hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
